    /**
     * Test position shifts with pre-computed results.
     */
    @Test(timeOut = POSITION_SHIFT_TEST_TIMEOUT)
    public void testPositionShifts() {
        for (Map.Entry<PositionShiftTestInput, int[][]> precomputedInput : //
        PRECOMPUTED_POSITION_SHIFT_RESULTS.entrySet()) {

            PositionShiftTestInput input = precomputedInput.getKey();
            RGBAPixel[][] inputArray = RGBAPixel.fromIntArray(input.inputArray);
            Assert.assertNotNull(inputArray);
            RGBAPixel[][] copyOfInput = RGBAPixel.copyArray(inputArray);
            RGBAPixel[][] expectedOutput = RGBAPixel.fromIntArray(precomputedInput.getValue());

            RGBAPixel[][] actualOutput = null;
            if (input.shiftLeft > 0) {
                actualOutput = Transform.shiftLeft(inputArray, input.shiftLeft);
            } else if (input.shiftRight > 0) {
                actualOutput = Transform.shiftRight(inputArray, input.shiftRight);
            } else if (input.shiftUp > 0) {
                actualOutput = Transform.shiftUp(inputArray, input.shiftUp);
            } else if (input.shiftDown > 0) {
                actualOutput = Transform.shiftDown(inputArray, input.shiftDown);
            }

            Assert.assertTrue(Arrays.deepEquals(RGBAPixel.toIntArray(actualOutput),
                        precomputedInput.getValue()),
                    "Expected:\n" + RGBAPixel.printArray(expectedOutput)
                    + "\nFound:\n" + RGBAPixel.printArray(actualOutput)
                    + "\nDiff:\n" + RGBAPixel.diffArrays(actualOutput, expectedOutput)
                    + "\n");
            Assert.assertTrue(Arrays.deepEquals(inputArray, copyOfInput),
                    "Input array was modified");
        }
    }

