    @Test(timeOut = MYSTERY_TEST_TIMEOUT)
    public void testMystery() {

        boolean mysteryModifiedSomething = false;
        for (int[][] input : PRECOMPUTED_MYSTERY_INPUTS) {
            RGBAPixel[][] inputArray = RGBAPixel.fromIntArray(input);
            Assert.assertNotNull(inputArray);
            RGBAPixel[][] copyOfInput = RGBAPixel.copyArray(inputArray);
            RGBAPixel[][] output = Transform.mystery(inputArray);

            if (!(Arrays.deepEquals(input, RGBAPixel.toIntArray(output)))) {
                mysteryModifiedSomething = true;
            }
            Assert.assertTrue(Arrays.deepEquals(inputArray, copyOfInput),
                    "Input array was modified");
        }
        Assert.assertTrue(mysteryModifiedSomething, "Mystery function does nothing");
    }

